import { styled } from '@mui/system'
import { Box,Paper, Stack,Button, Typography} from '@mui/material'
import React from 'react'
import Theme from '../../Component/Theme'; //**** Special import*/
import {ThemeProvider} from '@mui/material';
import img1 from '/media/nipuna/SSD FILES/FinalProject/FrontEnd/medi-ward-sri-lanka/src/Assest/mainlogo.png'

const theme=Theme();

const DemoPaper = styled(Paper)(({ theme }) => ({

    width: 1000,
    height:800,
    textAlign: 'center',
    borderRadius:theme.shape.borderRadius*6
  }));



const Login = () => {

  return (
    <ThemeProvider theme={theme}>
        <Stack bgcolor="white" display="flex" direction="row" justifyContent="center"  alignItems="center" sx={{
            marginTop:6,
            marginBottom:6,
        }}>
            <DemoPaper elevation={6}>
                <Stack display="flex" direction="row" justifyContent="space-between">
                    <Box flex="40%" sx={{
                        display:"flex",
                        justifyContent:"center",
                        alignItems:"center",
                        backgroundColor:theme.palette.primary.dark,
                        height:800,
                        borderTopLeftRadius:theme.shape.borderRadius*6,
                        borderBottomLeftRadius:theme.shape.borderRadius*6
                    }}>
                    <img src={img1} alt='Main_Logo' width="400px" height="400px"></img>
                    </Box>
                    <Box flex="55%" sx={{ 
                        height:800,
                        borderTopRightRadius:theme.shape.borderRadius*6,
                        borderBottomRightRadius:theme.shape.borderRadius*6,
                        display:"flex",
                        justifyContent:"center"
                    }}><Typography variant="h3">Welcome!</Typography></Box>
                </Stack>

            </DemoPaper>
        </Stack>
    </ThemeProvider>
  )
}

export default Login
